const {Header}=Layout;

export default function AppBar(){
  return (
    <Header style={styles.header}>
        {/* <Image style={styles.image} width={45} preview={false} src={Logo}/>
        &nbsp;
        <Title style={styles.title}>Instaverse</Title> */}
    </Header>
  )
}
